import {connect} from 'react-redux'
import CountUI from '../Count'
import {createAddAction,createDecreaseAction,creastanyscAction} from '../redux/count_action'

export default connect(
    (state)=> ({count:state}),
    (dispatch) =>({
      add:(data)=>dispatch(createAddAction(data)),
      jian:(data)=>dispatch(createDecreaseAction(data)),
      anysc:(data,time)=>dispatch(creastanyscAction(data,time))
    })
)(CountUI)
